import { Box, Button, InputBase, TextField } from '@material-ui/core';
import { withStyles } from '@material-ui/styles';
import React from 'react';

const style = (theme) => ({
  root: {}
});

const Header = (props) => {
  const { classes } = props;
  return (
    <Box bgcolor='rgb(1, 127, 255)' className={classes.root}>
      <Box
        style={{
          display: 'flex',
          width: 300,
          justifyContent: 'center',
          alignItems: 'center'
        }}
      >
        <a href='/' style={{ width: 60, height: 40 }}>
          <img
            style={{ width: '100%', height: '100%' }}
            src='https://salt.tikicdn.com/ts/upload/ae/f5/15/2228f38cf84d1b8451bb49e2c4537081.png'
          />
        </a>
      </Box>
      <Box style={{ display: 'flex' }}>
        <InputBase placeholder='Tìm sản phẩm, danh mục hay thương hiệu mong muốn' style={{
          background: '#fff'
        }} />
      </Box>
      <Button>
        <img src='https://salt.tikicdn.com/ts/upload/ed/5e/b8/8538366274240326978318348ea8af7c.png' />
        Tìm kiếm
      </Button>
      <img src='https://salt.tikicdn.com/ts/upload/67/de/1e/90e54b0a7a59948dd910ba50954c702e.png' />
      <label>Đăng nhập/Đăng kí</label>
      <label>Tài khoản</label>
      <img src='https://salt.tikicdn.com/ts/upload/40/44/6c/b80ad73e5e84aeb71c08e5d8d438eaa1.png' />
      <label>Giỏ hàng</label>
    </Box>
  );
};

export default withStyles(style)(Header);
